export async function submitScore(score) {
    try {
      await fetch("http://127.0.0.1:8000/api/score/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json"
        },
        body: JSON.stringify({ score })
      });
    } catch (err) {
      console.error("Score submit failed:", err);
    }
  }
